import React from "react";
import { NavLink } from 'react-router-dom';

function NavBar() {

    return (
        <div className = "topnav">
            <a href="/">Log Out</a>
            <NavLink to="/account">Account</NavLink>
            <NavLink to="/overview">Overview</NavLink>
        </div>
    )
}

export default NavBar
